import{_ as a,o as e,c as t,R as r}from"./chunks/framework.1nBpG9uI.js";const o="/zhaobao1830-notes/assets/01.ccaPuQEs.png",u=JSON.parse('{"title":"jar和war对比","description":"","frontmatter":{},"headers":[],"relativePath":"javaNotes/04.md","filePath":"javaNotes/04.md","lastUpdated":1704794233000}'),s={name:"javaNotes/04.md"},c=r('<h1 id="jar和war对比" tabindex="-1">jar和war对比 <a class="header-anchor" href="#jar和war对比" aria-label="Permalink to &quot;jar和war对比&quot;">​</a></h1><h2 id="打包方式" tabindex="-1">打包方式 <a class="header-anchor" href="#打包方式" aria-label="Permalink to &quot;打包方式&quot;">​</a></h2><p>jar文件是将所有的资源文件和Java类文件打包成一个jar文件</p><p>war文件则是将Web应用程序的所有资源文件和Java类文件打包成一个war文件</p><h2 id="部署方式" tabindex="-1">部署方式 <a class="header-anchor" href="#部署方式" aria-label="Permalink to &quot;部署方式&quot;">​</a></h2><p>jar文件部署需要当前服务器有java环境就可以，在cmd中，切换到jar包所在目录，执行命令 java -jar xxx.jar</p><p>war需要放到tomcat的webapps文件夹，启动tomcat进行部署</p><h2 id="适用场景" tabindex="-1">适用场景 <a class="header-anchor" href="#适用场景" aria-label="Permalink to &quot;适用场景&quot;">​</a></h2><p>jar适用于适用前后端分离项目，项目里只包含java相关代码</p><p>war适用于包含web代码的项目，比如jsp、html</p><div class="tip custom-block"><p class="custom-block-title">备注</p><p>SpringBoot项目在新建的时候，打包方式可以选择jar和war俩种，一般选择的是jar打包方式</p></div><h2 id="说明" tabindex="-1">说明 <a class="header-anchor" href="#说明" aria-label="Permalink to &quot;说明&quot;">​</a></h2><p><code>Please refer to dump files (if any exist) [date].dump, [date]-jvmRun[N].dump and [date]</code></p><p>Maven打包项目的时候，会进行代码测试，测试不通过就会报上面的错误，解决办法是：点击右上角的关闭测试按钮</p><p><img src="'+o+'" alt="Image text"></p>',15),p=[c];function i(d,n,l,h,_,m){return e(),t("div",null,p)}const b=a(s,[["render",i]]);export{u as __pageData,b as default};
